import React, { useEffect, useState} from 'react';
import { Link} from 'react-router-dom';

function HomePage(props) {
    
    const [data,setData]=useState([])

    useEffect(()=>{
        fetch('http://192.168.48.50:3000/')
        .then(res=>res.json())
        .then(results=>{
            console.log(results)
            setData(results)
        })
    },[])

    return (
        <div>
            {/* <Link to={{
            pathname:"/about",
            data:{
                Name:"Keshav Garg",
                Edu:"NITH"
            }
            }}>Banking System</Link> */}
            
            <div className='box'><span>Customer details</span></div>
            {data.map((item)=>{
                return <div>{item.name}</div>})}
                
        </div>
    );
}

export default HomePage;
